import React from 'react';
import './App.css';

function App() {

  const handleData = () => {
    fetch("https://covid19.mathdro.id/api/countries/[country]/confirmed")
    .then(res => {
      return res.json().then(res => {
        const newData = res.map(country => {
          return country
        })
        console.log(newData)
      })
    })
  }
  return (
    <div className="App">
      <header className="App-header">
      <p>Covid-19</p>
    <button onClick={handleData}>fetch</button>
      </header>
    </div>
  );
}

export default App;
